// @material-ui/icons
import Dashboard from "@material-ui/icons/Dashboard";
import Person from "@material-ui/icons/Person";
// import ContentPaste from "@material-ui/icons/ContentPaste";
import Notifications from "@material-ui/icons/Notifications";
// core components/views
import DashboardPage from "views/Dashboard/Sections/Dashboard.jsx";
import Profile from "views/Dashboard/Sections/Profile.jsx";
import ClubList from "views/Dashboard/Sections/ClubList.jsx";
import NotificationsPage from "views/Notifications/Notifications.jsx";

const dashboardRoutesUser = [
  /*{
    path: "/dash/dashboard",
    sidebarName: "Dashboard",
    navbarName: "Material Dashboard",
    icon: Dashboard,
    component: DashboardPage
  },*/
  {
      path: "/dash/profile",
      sidebarName: "User Profile",
      navbarName: "Profile",
      icon: Person,
      component: Profile
  },
  {
    path: "/dash/myclubs",
    sidebarName: "Mes clubs",
    navbarName: "Mes clubs",
    icon: Dashboard,
    component: ClubList
  },
  {
    path: "/dash/notifications",
    sidebarName: "Notifications",
    navbarName: "Notifications",
    icon: Notifications,
    component: NotificationsPage
  },
  { redirect: true, path: "/", to: "/", navbarName: "Redirect" }
];

export default dashboardRoutesUser;
